/** @jsxImportSource theme-ui */

import { Card, Image, Container, Heading, Paragraph } from "theme-ui";

const WebsiteBuilder = () => {
  return (
    <Card>
      <Image src="../images/#Image.png" alt="edit"></Image>
      <Container>
        <Heading>Build My Website</Heading>
        <Paragraph>
          Create your website with all new elements and features loaded website
          builder.
        </Paragraph>
      </Container>
    </Card>
  );
};

export default WebsiteBuilder;
